import React from "react";
import "./App.css";

const BrowserRouter = require("react-router-dom").BrowserRouter;

const Route = require("react-router-dom").Route;

const Link = require("react-router-dom").Link;
function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path="/">HI</Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
